import React, {Component} from 'react';

class App extends Component {
	state = {
	selectedFile: null
	};

	onFileChange = (event) => {
		this.setState({selectedFile: event.target.files[0]});
	};

    render() {
      return (
		<div>
        	<h> GRAPHMONKEY</h>
			<img src={"./monkey.png"} />
			<label> UPLOAD PNG
				<input type="file"  Change={this.onFileChange} />
			</label>
		</div>
     )
   }
 }

export default App
